import './StyleHeader.css';
import React from 'react';

const Header = ()=>{
    return <div className='header'>
        <p className='tag'>Some Text</p>
        <p className='nameOfUser'>Some Text</p>
        <div><p className='phoneNumber'>Some Text</p></div>
    </div>
}

export default Header;
